            address: {
              street: 'Calle falsa 123',
              city: 'Medellín',
              state: 'Poblado',
              postalCode: '55555',
              country: 'Colombia',
              phone: '+573111111111'
            }
          },
          buyer: {
            document: '1122334455',
            documentType: 'CC',
            name: 'John',
            surname: 'Doe',
            company: 'Evertec',
            email: 'johndoe@app.com',
            mobile: '+5731111111111',
            address: {
              street: 'Calle falsa 123',
              city: 'Medellín',
              state: 'Poblado',
              postalCode: '55555',
              country: 'Colombia',
              phone: '+573111111111'
            }
          },
          payment: {
            reference: '12345',
            description: 'Prueba de pago',
            amount: {
              currency: 'COP',
              total: 2000,
              taxes: [{kind: 'valueAddedTax', amount: 1000, base: 0}],
              details: [{kind: 'discount', amount: 1000}]
            },
            allowPartial: false,
            shipping: {
              document: '1122334455',
              documentType: 'CC',
              name: 'John',
              surname: 'Doe',
              company: 'Evertec',
              email: 'johndoe@app.com',
              mobile: '+5731111111111',
              address: {
                street: 'Calle falsa 123',
                city: 'Medellín',
                state: 'Poblado',
                postalCode: '55555',
                country: 'Colombia',
                phone: '+573111111111'
              }
            },
            items: [
              {
                sku: '12345',
